import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

interface Site {
  position: { x: number; y: number };
  scores: {
    safety: number;
    buildability: number;
    resources: number;
    expandability: number;
  };
  total_score: number;
}

interface SiteAnalysisPanelProps {
  sites: Site[];
}

const SiteAnalysisPanel: React.FC<SiteAnalysisPanelProps> = ({ sites }) => {
  // Take top 3 sites for detailed analysis
  const topSites = sites.slice(0, 3);

  // Prepare data for the bar chart
  const chartData = topSites.map((site, index) => ({
    name: `Site ${index + 1}`,
    safety: site.scores.safety,
    buildability: site.scores.buildability,
    resources: site.scores.resources,
    expandability: site.scores.expandability,
    total: site.total_score
  }));

  return (
    <div>
      {sites.length > 0 ? (
        <div>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-6">
            {topSites.map((site, index) => (
              <div key={index} className="bg-gray-700 p-4 rounded-lg">
                <h4 className="font-bold text-lg mb-2">Site {index + 1}</h4>
                <p className="text-sm text-gray-300">Position: ({site.position.x.toFixed(2)}, {site.position.y.toFixed(2)})</p>
                <div className="mt-3">
                  <div className="flex justify-between mb-1">
                    <span className="text-xs">Safety</span>
                    <span className="text-xs">{site.scores.safety.toFixed(1)}</span>
                  </div>
                  <div className="w-full bg-gray-600 rounded-full h-2">
                    <div 
                      className="bg-red-500 h-2 rounded-full" 
                      style={{ width: `${site.scores.safety}%` }}
                    ></div>
                  </div>

                  <div className="flex justify-between mb-1 mt-2">
                    <span className="text-xs">Buildability</span>
                    <span className="text-xs">{site.scores.buildability.toFixed(1)}</span>
                  </div>
                  <div className="w-full bg-gray-600 rounded-full h-2">
                    <div 
                      className="bg-yellow-500 h-2 rounded-full" 
                      style={{ width: `${site.scores.buildability}%` }}
                    ></div>
                  </div>

                  <div className="flex justify-between mb-1 mt-2">
                    <span className="text-xs">Resources</span>
                    <span className="text-xs">{site.scores.resources.toFixed(1)}</span>
                  </div>
                  <div className="w-full bg-gray-600 rounded-full h-2">
                    <div 
                      className="bg-blue-500 h-2 rounded-full" 
                      style={{ width: `${site.scores.resources}%` }}
                    ></div>
                  </div>

                  <div className="flex justify-between mb-1 mt-2">
                    <span className="text-xs">Expandability</span>
                    <span className="text-xs">{site.scores.expandability.toFixed(1)}</span>
                  </div>
                  <div className="w-full bg-gray-600 rounded-full h-2">
                    <div 
                      className="bg-green-500 h-2 rounded-full" 
                      style={{ width: `${site.scores.expandability}%` }}
                    ></div>
                  </div>

                  <div className="flex justify-between mb-1 mt-2">
                    <span className="text-xs font-bold">Total Score</span>
                    <span className="text-xs font-bold">{site.total_score.toFixed(1)}</span>
                  </div>
                  <div className="w-full bg-gray-600 rounded-full h-2">
                    <div 
                      className="bg-purple-500 h-2 rounded-full" 
                      style={{ width: `${site.total_score}%` }}
                    ></div>
                  </div>
                </div>
              </div>
            ))}
          </div>

          <div className="h-64">
            <ResponsiveContainer width="100%" height="100%">
              <BarChart
                data={chartData}
                margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
              >
                <CartesianGrid strokeDasharray="3 3" stroke="#444" />
                <XAxis dataKey="name" stroke="#aaa" />
                <YAxis stroke="#aaa" domain={[0, 100]} />
                <Tooltip 
                  contentStyle={{ backgroundColor: '#333', borderColor: '#555' }} 
                  itemStyle={{ color: '#fff' }} 
                  labelStyle={{ color: '#fff', fontWeight: 'bold' }}
                />
                <Legend />
                <Bar dataKey="safety" name="Safety" fill="#ef4444" />
                <Bar dataKey="buildability" name="Buildability" fill="#eab308" />
                <Bar dataKey="resources" name="Resources" fill="#3b82f6" />
                <Bar dataKey="expandability" name="Expandability" fill="#22c55e" />
                <Bar dataKey="total" name="Total Score" fill="#8b5cf6" />
              </BarChart>
            </ResponsiveContainer>
          </div>
        </div>
      ) : (
        <div className="text-center py-8 text-gray-500">
          <p>No habitat sites analyzed yet. The system is waiting for data from the robot.</p>
        </div>
      )}
    </div>
  );
};

export default SiteAnalysisPanel;
